function Login() {
  return <div className="form-signin w-100 m-auto" style={{
    maxWidth: "330px",
    padding: "1rem"
  }}>
    <form>
      <h1 className="h3 mb-3 fw-normal">Please sign in</h1>

      <div className="form-floating">
        <input type="email" className="form-control" id="floatingInput" placeholder="name@example.com" fdprocessedid="gwqkic" />
        <label htmlFor="floatingInput">Email address</label>
      </div>
      <div className="form-floating">
        <input type="password" className="form-control" id="floatingPassword" placeholder="Password" fdprocessedid="7sau3s" />
        <label htmlFor="floatingPassword">Password</label>
      </div>

      <button className="btn btn-primary w-100 py-2" type="submit" fdprocessedid="d6z06">Sign in</button>
    </form>
  </div>
};
export default Login;
